import numpy as np
from itertools import groupby


labels = [1, 3, 2, 1, 2, 3, 4, 1, 3, 4]
index = range(len(labels))
arr = sorted(list(zip(labels, index)), key=lambda x: x[0])
g = groupby(arr, key=lambda x: x[0])
res = []
for key, group in g:
    res.append([item[1] for item in list(group)])
print(res)
